  false,\n\t\"url\": null,\n\t\"notes\": \"The ship will conduct 24 hour operations
  consisting of daytime ROV dives and evening/nighttime mapping operations including
  during transit. During this cruise we will conduct primarily 8 hour ROV dives with
  occasional 10 or 12 hour dives on particularly interesting or deep water dive sites,
  as staffing allows.  ROV operations will focus in depths between 250 and 6,000 meters
  and will include high-resolution visual surveys and limited sample collection. Mapping
  operations will be conducted in 250m of water and deeper, and include transit and
  overnight multibeam, water column backscatter, and sub-bottom data collection.  Opportunistic
  CTD rosette operations may be requested to collect more information about the environmental
  parameters at ROV dives sites, or opportunistically at selected sites where collecting
  the data is considered important to understanding the physical or chemical properties
  of the overlying water column.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
